ï»¿using System.Reflection;
using UnityEditor;
using UnityEngine;

namespace TNRD.Automatron.Editor.Core {

    public class ExtendedGUI {

        private static GUIStyle defaultWindowStyle;
        public static GUIStyle DefaultWindowStyle {
            get {
                if ( defaultWindowStyle == null ) {
                    var t = typeof( GUI );
                    var f = t.GetField( "s_Skin", BindingFlags.NonPublic | BindingFlags.Static );

                    defaultWindowStyle = new GUIStyle( ( (GUISkin)f.GetValue( null ) ).window );
                    defaultWindowStyle.padding.top = 20;
                    defaultWindowStyle.contentOffset = new Vector2( 0, -19.5f );

                    var normalBytes = System.Convert.FromBase64String( @"" );
                    var normalTex = new Texture2D( 1, 1 );
                    normalTex.hideFlags = HideFlags.HideAndDontSave;
                    normalTex.LoadImage( normalBytes );
                    defaultWindowStyle.normal.background = normalTex;

                    var onNormalBytes = System.Convert.FromBase64String( @"" );
                    var onNormalTex = new Texture2D( 1, 1 );
                    onNormalTex.hideFlags = HideFlags.HideAndDontSave;
                    onNormalTex.LoadImage( onNormalBytes );
                    defaultWindowStyle.onNormal.background = onNormalTex;
                }

                return defaultWindowStyle;
            }
        }

        private static GUIStyle darkNoneWindowStyle;
        public static GUIStyle DarkNoneWindowStyle {
            get {
                if ( darkNoneWindowStyle == null ) {
                    darkNoneWindowStyle = new GUIStyle( GUIStyle.none );

                    var bytes = System.Convert.FromBase64String( @"" );
                    var texture = new Texture2D( 1, 1 );
                    texture.hideFlags = HideFlags.HideAndDontSave;
                    texture.LoadImage( bytes );
                    darkNoneWindowStyle.normal.background = darkNoneWindowStyle.onNormal.background = texture;
                }

                return darkNoneWindowStyle;
            }
        }

        private static GUIStyle boxStyle;
        public static GUIStyle BoxStyle {
            get {
                if ( boxStyle == null ) {
                    boxStyle = new GUIStyle( GUI.skin.box );

                    var bytes = System.Convert.FromBase64String( @"" );
                    var texture = new Texture2D( 1, 1 );
                    texture.hideFlags = HideFlags.HideAndDontSave;
                    texture.LoadImage( bytes );
                    boxStyle.normal.background = boxStyle.onNormal.background = texture;
                }

                return boxStyle;
            }
        }

        private static GUIStyle notificationBackgroundStyle;
        public static GUIStyle NotificationBackgroundStyle {
            get {
                if ( notificationBackgroundStyle == null ) {
                    notificationBackgroundStyle = new GUIStyle( "NotificationBackground" );
                }

                return notificationBackgroundStyle;
            }
        }

        private static GUIStyle notificationTextStyle;
        public static GUIStyle NotificationTextStyle {
            get {
                if ( notificationTextStyle == null ) {
                    notificationTextStyle = new GUIStyle( "NotificationText" );
                    notificationTextStyle.padding = new RectOffset( 20, 20, 20, 20 );
                    notificationTextStyle.fontSize = 17;
                }

                return notificationTextStyle;
            }
        }

        private static GUIStyle horizontalLineStyle = new GUIStyle() {
            normal = new GUIStyleState() { background = EditorGUIUtility.whiteTexture, textColor = Color.white },
            stretchWidth = true,
            margin = new RectOffset( 0, 0, 5, 5 )
        };

        private static Color horizontalLineColor = new Color( 0.349f, 0.349f, 0.349f );

        /// <summary>
        /// Draws a horizontal line
        /// </summary>
        /// <param name="thickness">The thickness of the line</param>
        public static void HorizontalLine( float thickness = 1 ) {
            HorizontalLine( horizontalLineColor, thickness );
        }

        /// <summary>
        /// Draws a horizontal line
        /// </summary>
        /// <param name="color">The color of the line</param>
        /// <param name="thickness">The thickness of the line</param>
        public static void HorizontalLine( Color color, float thickness = 1 ) {
            Rect position = GUILayoutUtility.GetRect( GUIContent.none, horizontalLineStyle, GUILayout.Height( thickness ) );

            if ( Event.current.type == EventType.Repaint ) {
                var guiColor = GUI.color;
                GUI.color = color;
                horizontalLineStyle.Draw( position, false, false, false, false );
                GUI.color = guiColor;
            }
        }

    }
}
#endif